// HasPostStatus applies the HasEdge predicate on the "post_status" edge.
func HasPostStatus() predicate.Post {
	return predicate.Post(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, PostStatusTable, PostStatusColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasPostStatusWith applies the HasEdge predicate on the "post_status" edge with a given conditions (other predicates).
func HasPostStatusWith(preds ...predicate.PostStatus) predicate.Post {
	return predicate.Post(func(s *sql.Selector) {
		step := newPostStatusStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

